        public static int solve(int number)
        {
            const int mod = 1000000007;
            if (number == 0)
            {
                return 0;
            }

            var powerOfTwo = largestPowerOfTwo(number);
            Console.WriteLine(powerOfTwo);
            long beforePowerOfTwo = powerOfTwo * (1 << (powerOfTwo - 1));
            var msbBits = (number - (1 << powerOfTwo) + 1);
            var remainingNumbers = number - (1 << powerOfTwo);
            var remFunc = solve(remainingNumbers);

            return ((int)((beforePowerOfTwo % mod) + (msbBits % mod) + (remFunc % mod))) % mod;
        }

        public static int largestPowerOfTwo(int num)
        {
            var x = 0;

            while ((1 << x) <= num)
            {
                x++;
            }

            return x - 1;
        }


