        public static ListNode ReverseList(ListNode head)
        {
            var curr = head;
            ListNode next = null, prev = null;

            while (curr != null)
            {
                next = curr.next;
                curr.next = prev;

                prev = curr;
                curr = next;
            }

            return prev;
        }

        public static ListNode ReverseBetween(ListNode head, int left, int right)
        {
            var dummy = new ListNode(0, head);
            ListNode leftPrev = dummy, curr = head;

            for (int i = 0; i < left-1; i++)
            {
                leftPrev = curr;
                curr = curr.next;
            }

            ListNode prev = null, currentNode = curr, next = null;

            for (var j = 1; j <= (right - left + 1); j++)
            {
                next = currentNode.next;
                currentNode.next = prev;
                prev = currentNode;
                currentNode = next;
            }

            leftPrev.next.next = currentNode;
            leftPrev.next = prev;

            //var nextNode = leftPrev.next;
            //leftPrev.next = prev;
            //nextNode.next = next;

            return dummy.next;
        }

        public static ListNode ReverseBetweenScaler(ListNode A, int B, int C)
        {
            ListNode head = A, beforeReversePrev = null;

            if (A == null || A.next == null)
            {
                return A;
            }

            for (int i = 0; i < B - 1; i++)
            {
                beforeReversePrev = head;
                head = head.next;
            }

            int toRotate = (C - B + 1);
            ListNode next = null, prev = null, currNode = head;

            for (int i = 1; i <= toRotate; i++)
            {
                next = currNode.next; //3
                currNode.next = prev; //null
                prev = currNode; //2
                currNode = next; // 3
            }

            prev.next = next.next;
            currNode.next = prev;

            beforeReversePrev.next = currNode;

            // currNode.next = next;
            // beforeReversePrev.next = prev;

            // leftPrev.next.next = currentNode;
            // leftPrev.next = prev;

            return head;
        }
